title:
  english: Psalm 65:11 - 81:1
  arabic: "مزامير ٦٥:١١ - ٨١:١"
text:
  english: You crown the year with Your goodness, And Your paths drip with
    abundance. Sing aloud to God our strength; Make a joyful shout to the God of
    Jacob.
  arabic: كللت السنة بجودك وآثارك تقطر دسماً رنموا لله قوتنا اهتفوا لإله يعقوب
